response.about:
я терпелив, разумен и красив.

люблю: чай с карицей и зеленый; вегетарианскую еду; как меняеться погода из-зо дня в день; дорогие машины; меняться к лучшему; своих друзей и врагов;
работать;

не люблю: торчать дома; врать ( все врут ); бегот по утрам; пробки на дорогах;

Я буду победителем в этой жизни!

очень любопытный.

не сижу на месте, добиваюсь всего, что мне нужно.
